import React from "react";
import "./FormInput.css";

const FormInput = () => {
  return (
    <form>
      <label for="username">Username</label>
      <input id="username" type="text" />
      <label for="age"></label>
      <input id="age" type="text" />
    </form>
  );
};

export default FormInput;
